import React, { Component } from 'react'

import './login.css'

class Login extends Component {

    handleSubmit = function() {
        alert("shit")
    }.bind(Login);

    render() {
        return (
            <div className='outer'>
                <div className='inner'>
                    <h1>Login</h1>
                    <form onSubmit={ this.handleSubmit }>
                        <p>Email Address</p>
                        <input type='text'/>
                        <p>Password</p>
                        <input type='text'/>
                        <p> </p>
                        <button>Submit</button>
                        <p className='text'>Don't have an account?
                            <a href=''>Create one</a>
                        </p>
                    </form>
                </div>
            </div>
        );
    }
}

export default Login
